INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (4, 0.0, 0.0, 1, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24015, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (1, 0.0, 4.0, 2, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24016, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (4, 0.0, 0.0, 3, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24017, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (2, 0.0, 5.2, 4, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24018, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (6, 0.0, 4.2, 5, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24019, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (2, 0.0, 0.0, 6, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24020, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (6, 0.0, 6.4, 7, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24021, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (2, 0.0, 0.0, 8, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24022, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (3, 0.0, 10.08, 9, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24023, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (2, 0.0, 5.0, 10, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24024, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (2, 0.0, 0.0, 11, 10021, 24, 110501, 0.0, "カオリ（サマー）", 24025, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
